import axios from "axios";

import authHeader from './auth-header';

const API_URL = "http://localhost:5000/api/admin/courseApplications";



class Get_Update {
    

    Getting() {
        
        const header={ headers: authHeader()}
        
        return axios.get(API_URL, 
            header
        )
    }

    
}

export default new Get_Update ();
